import React from "react";
import { Link } from "react-router-dom";
import "../App.css"

const Navbar = () => {
  return (
    <>
      <Link to='/'>Home</Link>
      <Link to='/auth'>Auth</Link>
      <Link to='/create-recipe'>create recipe</Link>
      <Link to='/saved-recipe'>saved recipe</Link>
    </>
  );
};

export default Navbar;
